export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},YDps1TbQnj:{data:{id:1704,attributes:{imdbId:"tt0080966",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYjIyNzA4OGUtZDE5MC00YjQ0LThhNDYtOGNlODg1NDUxMTQ0XkEyXkFqcGdeQXVyMjkxNzM0MjM@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.8\u002F10"}],item_lang:{data:{id:2367,attributes:{title:g,plot:"Based on Joni Eareckson's autobiography. She becomes paralyzed after breaking her neck in a swimming accident at age 17. Trying to cope with her new life, she learns to paint using her mouth and finds strength in her new Christian faith.",slug:"joni"}}},books:{data:[{id:8755,attributes:{title:g,description:"One of the most beloved Christian autobiographies of modern times, Joni highlights the unforgettable story of a young woman's courageous struggle to find hope after a broken neck left her completely paralyzed. On a hot July afternoon, Joni Eareckson Tada's life was dramatically altered in a split second. A reckless dive into shallow water took an athletic young woman from health and success to life as a quadriplegic in a wheelchair. In the forty-five years since the release of this book--which has more than five million copies in print in over forty languages--Joni's earnest struggle to find hope has resonated with millions of readers around the world. The hard-earned truths she shares in this special edition reveal the power of God's love to transform, as well as the triumph of faith over pain and suffering. Joni's message has inspired people facing all types of challenges, helping them overcome their own limitations with a determined smile. In this updated edition, you will discover how to stay satisfied in God through disappointment and affliction. Filled with practical insights, Joni will help you find hope in every hardship. This commemorative 45th anniversary edition features updated photos, as well as an all-new afterword in which Joni describes her current battle against two different cancers, her daily struggle with chronic pain, and the joys of leading a global outreach to people living with disability.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=8QIlEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2021-11-16",publisher:d,subtitle:"An Unforgettable Story"}},{id:8756,attributes:{title:"Heaven",description:"Step back a moment, focus your eyes of faith, and then come with Joni into a world you've heard about from your youth but have never seen: heaven. You just might discover that heaven is closer - and more real - than you've ever thought. In this joyful best-seller, Joni Eareckson Tada paints a shining portrait of our heart's true home. Joni talks about what heaven will be like, what we'll do, and whom we'll see. She shows how heaven will be the satisfaction of all that our hearts cry for, something more real than anything this side of eternity. And Joni tells how we can prepare now for the reality of heaven. With hope for today and vision for those who struggle in life, Heaven invites us to a refreshing and faith-filled picture of our glorious destination. Once you've caught a glimpse of heaven, you'll see earth in a whole new light.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=cQrPd8R0o0kC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Joni Eareckson-Tada"],firstBook:c,published:"2010-09-01",publisher:"ReadHowYouWant.com",subtitle:"Your Real Home"}},{id:8757,attributes:{title:"A Step Further",description:"Personal answers to the difficult \"whys\" of suffering. Originally published in 1978, A Step Further is Joni Eareckson Tada's response to thousands of letters she received from people puzzled about the \"whys\" of suffering. Joni answers these questions by taking a personal look at how God has used circumstances, people, and events in her own life and the lives of others. A Step Further has been used by individuals, in hospitals and rehab centers, and in scores of countries overseas to bring comfort and peace to those who are suffering. It is available in over 30 different languages.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=JRWdDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b,"Steve Estes"],firstBook:c,published:"2019-07-23",publisher:d,subtitle:"Growing Closer to God through Hurt and Hardship"}},{id:8758,attributes:{title:"Tell Me the Promises",description:"A collection of seven stories written to illustrate commitments between parent and child such as always protecting the child and always telling the truth.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=hJED1STSMnAC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b,"Steve Jensen"],firstBook:c,published:"1996-01-01",publisher:"Crossroad Publishing Company",subtitle:"A Family Covenant for Eternity"}},{id:8759,attributes:{title:"Joni and Ken",description:"This is the true love story of Joni and her husband of 30 years, Ken Tada. A love story showing what it truly means for a man and a woman to live in love … in sickness and in health. Even the honeymoon wasn’t easy. Did Ken realize what he was getting into when he proposed to Joni, a quadriplegic woman? As their marriage years moved on, Ken became increasingly overwhelmed by the never-ceasing demands of caring for Joni, who begins to experience chronic, extreme, nightmarish pain. Ken sinks into depression, and the couple finds themselves on parallel tracks in life, married and living under the same roof but drifting apart emotionally. But as they fight for their marriage and find their way through the mazes of depression and pain, they wrap their two lives around their rock—Jesus. During Ken’s denial of Joni’s diagnosis, and Joni’s thoughts of how wonderful a quick exit to heaven would be, they experience a personal visitation with the savior you will never forget.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=pGx0gXh7vS8C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Ken Tada",b],firstBook:c,published:"2013-04-02",publisher:d,subtitle:"An Untold Love Story"}}]}}},meta:{}}},prerenderedAt:1681309531603}}("movie","Joni Eareckson Tada",null,"Zondervan","series",1,"Joni"))